export const FullPage = styled.div`
width: 100vw;
height: 100vh;
padding-left: 30px;
padding-right: 40px;
`;
export const LeftSide = styled.div`
width: 28vw;
height: 100vh;
float: left;
`;
export const RightSide = styled.div`
width: 65vw;
height: 100vh;
display: table;
float: right;
`;
